window.bookSummaryJSON = "<p>No one survived the last battle unscathed. Flint is angry at the world, Jaxon is turning into something I don’t recognize, and Hudson has put up a wall I’m not sure I’ll ever break through.<br> <br> Now war is coming, and we’re not ready. We’re going to need an army to have any hope of winning. But first, there are questions about my ancestors that need answers. Answers that might just reveal who the real monster is among us.<br> <br> And that’s saying something in a world filled with bloodthirsty vampires, immortal gargoyles, and an ancient battle between two gods.<br> <br> There’s no guarantee that anyone will be left standing when the dust settles, but if we want to save this world, I have no choice. I’ll have to embrace every part of me...even the parts I fear the most.<br> <br> Adapted from the novel and produced with a full cast of actors, immersive sound effects and cinematic music!<br> <br> Performed by Stewart Crank, Melody Muze, Yenni Ann, Wyn Delano, Anthony Palmini, Sara Matsui-Colby, Andrew James Spooner, Christopher Tester, Ian Russell, Karen Novack, Gabriel Michael, Drew Kopas, Eric Messner, David Cui Cui, Marissa Clay, Chris Stinson, Eva Wilhelm, Bradley Foster Smith, Maria Amelia Park, Nora Achrati, Charlie Albers, Laura C. Harris, Mike Carnes, Daniel Llaca, Emlyn McFarland, Crystal Lee, Zura Johnson, Matthew Bassett, Terence Aselford, Donald Guzzi, and JW Rone.</p>"; 
